import React, {Component} from 'react';
import { Route , withRouter} from 'react-router-dom'

class UserName extends Component {

    constructor(props) {
        super(props);
        this.state = {
            curName: this.props.name
        }
    }

    setName = (name) => {
        console.log(name);
        this.setState({curName: name});
    };

    // startChat = () => {
    //     this.props.history.push(`/chat`);
    // }

    render() {
      return (
        <div className="App">
          <header className="App-header">
            <h1>
              {this.state.name} Testing Web Sockets!
            </h1>

            <form onSubmit={this.handleSubmit}>
              <label>
                <p>User : </p>
                <textarea value={this.state.name} onChange={(event) => {
                  this.setState({name: event.target.value});
                }}/>
              </label>
            </form>

            <button onClick={this.props.startChat(this.curName)}>Start Chatting!</button> 

          </header>
        </div>
      )
    }
  }

  export default withRouter(UserName);
